import React, { Component } from 'react';

const jobDescriptionsPanelStyle = {
  display: 'flex',
  flex: 11,
};

class JobDescriptionsPanel extends Component {
  render() {
    return (
      <div style={jobDescriptionsPanelStyle}>
        <h1>Job Descriptions</h1>
        <ul>
          <li>Job Description One</li>
          <li>Job Description Two</li>
          <li>Job Description Three</li>
        </ul>
      </div>
    );
  }
}

export default JobDescriptionsPanel;
